-- Disable triggers
SET session_replication_role = 'replica';

-- Drop all existing tables (if any)
DO $$ 
DECLARE 
    r RECORD;
BEGIN
    FOR r IN (SELECT tablename FROM pg_tables WHERE schemaname = current_schema()) 
    LOOP
        EXECUTE 'DROP TABLE IF EXISTS ' || quote_ident(r.tablename) || ' CASCADE';
    END LOOP;
END $$;

-- Start of schema creation
CREATE TABLE django_admin_log (
    id SERIAL PRIMARY KEY NOT NULL,
    action_time timestamp with time zone NOT NULL,
    user_id integer NOT NULL,
    content_type_id integer NULL,
    object_id text NULL,
    object_repr text NOT NULL,
    action_flag text NOT NULL,
    change_message text NOT NULL
);
CREATE TABLE auth_permission (
    id SERIAL PRIMARY KEY NOT NULL,
    name text NOT NULL,
    content_type_id integer NOT NULL,
    codename text NOT NULL
);
CREATE TABLE auth_group (
    id SERIAL PRIMARY KEY NOT NULL,
    name text NOT NULL
);
CREATE TABLE auth_user (
    id SERIAL PRIMARY KEY NOT NULL,
    password text NOT NULL,
    last_login timestamp with time zone NULL,
    is_superuser text NOT NULL,
    username text NOT NULL,
    first_name text NOT NULL,
    last_name text NOT NULL,
    email text NOT NULL,
    is_staff text NOT NULL,
    is_active text NOT NULL,
    date_joined timestamp with time zone NOT NULL
);
CREATE TABLE django_content_type (
    id SERIAL PRIMARY KEY NOT NULL,
    app_label text NOT NULL,
    model text NOT NULL
);
CREATE TABLE django_session (
    session_key text NOT NULL,
    session_data text NOT NULL,
    expire_date timestamp with time zone NOT NULL
);
CREATE TABLE blog_blogpost (
    id SERIAL PRIMARY KEY NOT NULL,
    title text NOT NULL,
    content text NOT NULL,
    author text NOT NULL,
    slug text NOT NULL,
    date timestamp with time zone NOT NULL,
    thumb text NOT NULL
);
CREATE TABLE app_theme (
    id SERIAL PRIMARY KEY NOT NULL,
    name text NOT NULL,
    color text NOT NULL
);
CREATE TABLE app_language (
    id SERIAL PRIMARY KEY NOT NULL,
    name text NOT NULL,
    short text NOT NULL
);
CREATE TABLE app_profile (
    id SERIAL PRIMARY KEY NOT NULL,
    user_id integer NOT NULL,
    bio text NOT NULL,
    profile_pic text NOT NULL,
    date_of_birth text NOT NULL,
    final_age integer NOT NULL,
    premium text NOT NULL,
    theme_id text NULL,
    language_id integer NULL
);
CREATE TABLE app_year (
    id SERIAL PRIMARY KEY NOT NULL,
    value integer NULL
);
CREATE TABLE app_week (
    id SERIAL PRIMARY KEY NOT NULL,
    value integer NULL,
    year_id integer NOT NULL,
    date_start text NOT NULL,
    date_end text NOT NULL
);
CREATE TABLE app_category (
    id SERIAL PRIMARY KEY NOT NULL,
    name text NOT NULL,
    default_color text NOT NULL
);
CREATE TABLE app_vision (
    id SERIAL PRIMARY KEY NOT NULL,
    category_id integer NOT NULL,
    content text NOT NULL,
    image text NOT NULL
);
CREATE TABLE app_weeki (
    id SERIAL PRIMARY KEY NOT NULL,
    category_id integer NOT NULL,
    favorite text NOT NULL,
    content text NOT NULL,
    user_id integer NULL,
    week_id integer NOT NULL,
    date_created timestamp with time zone NOT NULL,
    image text NOT NULL
);
CREATE TABLE app_errorlog (
    id SERIAL PRIMARY KEY NOT NULL,
    timestamp timestamp with time zone NOT NULL,
    url text NOT NULL,
    error_message text NOT NULL,
    stack_trace text NULL,
    user_id integer NULL,
    additional_data text NULL
);

